import React, { Component } from 'react';

class Product extends Component {
    render() {
        return (
            <div className="col-4 mt-2 mb-2">
                <div className="card text-left">
                    <img className="card-img-top" src="http://kenh14cdn.com/zoom/460_289/2019/7/9/untitled-2-15626762890311515904535-crop-15626763093011643121812.png" alt="demo" />
                    <div className="card-body">
                        <h5 className="card-title float-left">Tên sản phẩm xuất khẩu từ Nga</h5>
                        <h5 className="card-title float-right">500.000Đ</h5>
                    </div>
                </div>
            </div>
        );
    }
}

export default Product;
